import { makeStyles } from '@material-ui/core/styles';

const BodyStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: '#F5F5F5',
        flexGrow: 1,
        marginTop: theme.spacing(3)
    },
    container: {
        backgroundColor: '#F5F5F5',
        flexGrow: 1,
        marginTop: theme.spacing(3)
    },
}));

export default BodyStyle;
